## 1. 한국어 Sparql 활용 예제 1
# 장소 프로퍼티를 가지고 있는 아티클 100개를 가져온다.

from SPARQLWrapper import SPARQLWrapper, JSON

sparql = SPARQLWrapper(
    'http://ko.dbpedia.org/sparql'
)
sparql.setReturnFormat(JSON)

# gets the first 10 geological ages
# from a Geological Timescale database,
# via a SPARQL endpoint
sparql.setQuery("""
    select * where {
 ?s <http://ko.dbpedia.org/property/장소> ?o
 } LIMIT 10
 """
)

try:
    ret = sparql.queryAndConvert()

    for r in ret["results"]["bindings"]:
        print(r)
except Exception as e:
    print(e)

## . 한국어 Sparql 활용 예제 2
# 대한 민국을 국적으로 가지고 있는 사람을 모두 가져온다.

from SPARQLWrapper import SPARQLWrapper, JSON

sparql = SPARQLWrapper(
    'http://ko.dbpedia.org/sparql'
)
sparql.setReturnFormat(JSON)

# gets the first 10 geological ages
# from a Geological Timescale database,
# via a SPARQL endpoint
sparql.setQuery("""
PREFIX dbo: <http://dbpedia.org/ontology/>
PREFIX dbp: <http://ko.dbpedia.org/property/>
PREFIX res: <http://ko.dbpedia.org/resource/>
PREFIX foaf: <http://xmlns.com/foaf/0.1/>
PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
select * where {
    ?s rdf:type foaf:Person.
    ?s <http://ko.dbpedia.org/property/국가> '대한민국'@ko.
} LIMIT 20
 """
)

try:
    ret = sparql.queryAndConvert()

    for r in ret["results"]["bindings"]:
        print(r)
except Exception as e:
    print(e)

